import React from "react";


export default function Menu(){
    return(
        <section id="menu">
            <div>
                <div>
                    <h2>Today</h2>
                </div>
                <div>
                    <h2>Upcoming</h2>
                </div>
                <div>
                    <h2>Notes</h2>
                </div>
                
            </div>
        </section>
    );
}
